import { Button, AppBar, Card, CardContent, CardHeader, TextField, CircularProgress, Container, Grid, IconButton, makeStyles, Toolbar, Typography, Box } from "@material-ui/core";
import { Alert, AlertTitle } from "@material-ui/lab";
import { useSnackbar } from "notistack";
import { useEffect, useState } from "react";
import { getUserInfo } from "../../services/user.service";
import { Person, Menu as MenuIcon } from "@material-ui/icons";
import authService from "../../services/auth.service";
import { useNavigate } from "react-router-dom";
import {axios} from "axios";
import logo from '../../images/logo.png';

const useStyles = makeStyles((theme) => ({
    root: {
        height: "100%"
    },
    grid: {
        height: "100%"
    },
    logoutBtn: {
        marginLeft: "auto"
    }
}));


export default function AccountView(props) {

    //update Balance
        function updateBalance(val){

            const name = window.localStorage.getItem("name");
            const amount = parseFloat(window.localStorage.getItem("amount")); //
            const type = window.localStorage.getItem("type");
            const savings_goal = parseFloat(window.localStorage.getItem("savings_goal")); //



            var requestOptions = {
              method: 'POST'
            };
            console.log(name + "/" + amount + "/" + val + "/" + type + "/" + savings_goal);

            fetch("http://localhost:8080/newExpensesIncomes/8/" + name + "/" + amount + "/" + val + "/" + type + "/" + savings_goal, requestOptions) ///newExpensesIncomes/{t_id}/{u_id}/{amount}/{balance}/{type}/{savings_goal}
              .then(response => response.text())
              .then(result => console.log(result))
              .catch(error => console.log('error', error));
        }


    const headuser = localStorage.getItem("user");
    const headname = localStorage.getItem("name");
    const headtoken = localStorage.getItem("token");

    console.log(headuser);
    console.log(headname);
    console.log(headtoken);

    const msgTwo = "Welcome, " + headname + "!";
    const msgThree = "Welcome, " + headname + "! Below should be the Balance YTD";

    const [bal, setBal] = useState();

    const handleLogin = (e) => {
                e.preventDefault();
                updateBalance(bal);
                window.location.href = "http://localhost:5173/myAccount";
    };

    function convert(currency){
        var k, temp;
        // Loop to make substring
        for(var i = 0; i < currency.length; i++){

            // Getting Unicode value
            k = currency.charCodeAt(i);

            // Checking whether the character
            // is of numeric type or not
            if(k > 47 && k < 58){

                // Making substring
                temp = currency.substring(i);
                break;
            }
        }

        // If currency is in format like
        // 458, 656.75 then we used replace
        // method to replace every ', ' with ''
        temp = temp.replace(/, /, '');

        // Converting string to float
        // or double and return
        return parseFloat(temp);


        }








return (
    <div>
        <Container maxWidth={false} className="App-header-short">
            <ul className="stacked-window">
                <li >
                    <Container className="content-window-one">
                        Commerce Bank App
                    </Container>
                    <Container maxWidth={"sm"} id="accountForm">
                                                        <Card id="formTwo" >

                                                            <CardHeader title={"My Account"} class="heading"/>
                                                            <CardHeader title={msgTwo} className="msg" titleTypographyProps={{variant:'h6' }}/>
                                                            <CardContent >
                                                                <form onSubmit={handleLogin}>

                                                                            <TextField
                                                                                variant="outlined"
                                                                                placeholder={"Balance"}
                                                                                fullWidth
                                                                                className="field"
                                                                                decimalsLimit={2}
                                                                                value={bal ?? ""}
                                                                                onChange={e => setBal(e.target.value)}
                                                                                onValueChange={(value, name) => console.log(value, name)}
                                                                            />
                                                                            <TextField
                                                                                variant="outlined"
                                                                                placeholder={"Payment"}
                                                                                fullWidth
                                                                                className="field"
                                                                                decimalsLimit={2}
                                                                                onValueChange={(value, name) => console.log(value, name)}
                                                                                prefix="$"
                                                                            />
                                                                            <TextField
                                                                                variant="outlined"
                                                                                placeholder={"Recurring Payment"}
                                                                                fullWidth
                                                                                className="field"
                                                                                decimalsLimit={2}
                                                                                onValueChange={(value, name) => console.log(value, name)}
                                                                                prefix="$"
                                                                            />
                                                                            <TextField
                                                                                variant="outlined"
                                                                                placeholder={"Income"}
                                                                                fullWidth
                                                                                className="field"
                                                                                decimalsLimit={2}
                                                                                onValueChange={(value, name) => console.log(value, name)}
                                                                                prefix="$"
                                                                            />
                                                                           <Button type="submit" id="loginButtonTwo"> Submit</Button>
                                                                           <Button type="reset" value="Reset" id="loginButtonTwo"> Clear</Button>
                                                                </form>
                                                            </CardContent>
                                                        </Card>
                                        </Container>
                </li>
                <li >
                    <Container className="content-window-two">
                        {msgThree}

                    </Container>
                </li>
            </ul>

        </Container>

    </div>






);

}
